const GraphGrid = ({ receiverPosition }) => (
  <div className="graph-grid">
    {/* Horizontal Axis */}
    {[...Array(64)].map((_, index) => (
      index < 8 && (
        <div
          key={`h-axis-${index}`}
          className="axis-line horizontal"
          style={{ top: `calc(${index * 100}px)` }}
        ></div>
      )
    ))}

    {/* Vertical Axis */}
    {[...Array(64)].map((_, index) => (
      index < 8 && (
        <div
          key={`v-axis-${index}`}
          className="axis-line vertical"
          style={{ left: `calc(${index * 100}px)` }}
        ></div>
      )
    ))}

    {/* Grid Cells */}
    {[...Array(64)].map((_, index) => (
      <div key={index} className="grid-cell"></div>
    ))}

    {/* Red Square */}
    <div
      className="red-square"
      style={{
        top: `calc(${receiverPosition.row} * 100px)`,
        left: `calc(${receiverPosition.column} * 100px)`,
      }}
    ></div>
  </div>
);

export default GraphGrid;
